import React from 'react';
import Sidebar from './Sidebar';

import '../css/app.css';
import Mainpage from './Mainpage';

function App() {
  console.log(samplePlans);
  return (
    <div className="main">
      <div className="plan">
        <Sidebar></Sidebar>
        <Mainpage monthlyPlans={samplePlans}></Mainpage>
      </div>
    </div>
  );

  const samplePlans = [
    {
      id: 1,
      name: 'Arcade',
      price: '$9/mo',
    },
    {
      id: 2,
      name: 'Advanced',
      price: '$12/mo',
    },
    {
      id: 3,
      name: 'Pro',
      price: '$15/mo',
    },
  ];
}

export default App;
